import {CustomLogin} from './components/loginForm'
import {Logo} from './components/UI/logo'

function App() {
  return (
    <div 
      css={{
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        width: '100%',
        height: '100vh',
      }}
    >
      <Logo width="80" height="80" />
      <h1>Bookshelf</h1>
      <div
        css={{
          display: 'grid',
          gridTemplateColumns: 'repeat(2, minmax(0, 1fr))',
          gripGap: '0.75rem',
        }}
      >
      <CustomLogin />
      </div>
    </div>
  );
}

export default App;
